package main

import (
	"fmt"
	"sort"
)

func maxProfitAssignment(difficulty []int, profit []int, worker []int) int {
	dpMap, wMaxProfit, ld := make(map[int]int), make(map[int]int), difficulty[0]

	for idx, d := range difficulty {
		if dpMap[d] < profit[idx] {
			dpMap[d] = profit[idx]
		}
		if d < ld {
			ld = d
		}
	}

	sort.Slice(difficulty, func(i int, j int) bool {
		return difficulty[i] > difficulty[j]
	})
	sort.Slice(worker, func(i int, j int) bool {
		return worker[i] > worker[j]
	})

	for wi, w := range worker {
		for _, d := range difficulty {
			if d > w {
				continue
			}
			if dpMap[d] > wMaxProfit[wi] {
				wMaxProfit[wi] = dpMap[d]
			}
		}
	}

	result := 0

	for _, p := range wMaxProfit {
		result += p
	}

	return result
}

func printResult(result int, expected int) {
	fmt.Println("Result: ", result)
	fmt.Println("Expected: ", expected)
	println()
}

